import json
from datetime import datetime

def format_date(date_string):
    # Parse the ISO format date string
    dt = datetime.fromisoformat(date_string.replace('Z', '+00:00'))
    # Format the date as requested
    return dt.strftime('%Y-%m-%d %H:%M:%S (UTC+0)')

def map_reputation_to_severity(reputation):
    if reputation is None or reputation == "":
        return "null"
    try:
        reputation = int(reputation)
        severity_map = {
            0: 'unknown',
            1: 'suspicious',
            2: 'malicious',
            3: 'whitelisted',
            4: 'shared'
        }
        return severity_map.get(reputation)
    except (ValueError, TypeError):
        return "null"

def main(input_data):
    # Get values from input dictionary
    date_string = input_data.get('date_string')
    reputation = input_data.get('reputation')

    # Process and return results
    result = {
        'severity': map_reputation_to_severity(reputation)
    }

    # Only add formatted_date if date_string exists
    if date_string:
        result['formatted_date'] = format_date(date_string)

    return result
